y large and transnational companies, to adopt sustainable practices and to integrate sustainability information into their reporting cycle',12,'SDG 12 - Responsible Consumption and Production'),(76,'12.7','Promote public procurement practices that are sustainable, in accordance with national policies and priorities',12,'SDG 12 - Responsible Consumption and Production'),(77,'12.8','By 2030, ensure that people everywhere have the relevant information and awareness for sustainable development and lifestyles in harmony with nature',12,'SDG 12 - Responsible Consumption and Production'),(78,'13.1','Strengthen resilience and adaptive capacity to climate-related hazards and natural disasters in all countries',13,'SDG 13 - Climate Action'),(79,'13.2','Improve education, awareness-raising and human and institutional capacity on climate change mitigation, adaptation, impact reduction and early warning',13,'SDG 13 - Climate Action'),(80,'14.1','By 2025, prevent and significantly reduce marine pollution of all kinds, in particular from land-based activities, including marine debris and nutrient pollution',14,'SDG 14 - Life Below Water'),(81,'14.2','By 2020, sustainably manage and protect marine and coastal ecosystems to avoid significant adverse impacts, including by strengthening their resilience, and take action for their restoration in order to achieve healthy and productive oceans',14,'SDG 14 - Life Below Water'),(82,'14.3','Minimize and address the impacts of ocean acidification, including through enhanced scientific cooperation at all levels',14,'SDG 14 - Life Below Water'),(83,'14.4','By 2020, effectively regulate harvesting and end overfishing, illegal, unreported and unregulated fishing and destructive fishing practices and implement science-based management plans, in order to restore fish stocks in the shortest time feasible, at least to levels that can produce maximum sustainable yield as determined by their biological characteristics',14,'SDG 14 - Life Below Water'),