nificant action to reduce the degradation of natural habitats, halt the loss of biodiversity and, by 2020, protect and prevent the extinction of threatened species',15,'SDG 15 - Life on Land'),(92,'15.6','Promote fair and equitable sharing of the benefits arising from the utilization of genetic resources and promote appropriate access to such resources, as internationally agreed',15,'SDG 15 - Life on Land'),(93,'15.7','Take urgent action to end poaching and trafficking of protected species of flora and fauna and address both demand and supply of illegal wildlife products',15,'SDG 15 - Life on Land'),(94,'15.8','By 2020, introduce measures to prevent the introduction and significantly reduce the impact of invasive alien species on land and water ecosystems and control or eradicate the priority species',15,'SDG 15 - Life on Land'),(95,'15.9','By 2020, integrate ecosystem and biodiversity values into national and local planning, development processes, poverty reduction strategies and accounts',15,'SDG 15 - Life on Land'),(96,'16.1','Significantly reduce all forms of violence and related death rates everywhere',16,'SDG 16 -  Peace and Justice Strong Institutions'),(97,'16.2','End abuse, exploitation, trafficking and all forms of violence against and torture of children',16,'SDG 16 -  Peace and Justice Strong Institutions'),(98,'16.3','Promote the rule of law at the national and international levels and ensure equal access to justice for all',16,'SDG 16 -  Peace and Justice Strong Institutions'),(99,'16.4','By 2030, significantly reduce illicit financial and arms flows, strengthen the recovery and return of stolen assets and combat all forms of organized crime',16,'SDG 16 -  Peace and Justice Strong Institutions'),(100,'16.5','Substantially reduce corruption and bribery in all their forms',16,'SDG 16 -  Peace and Justice Strong Institutions'),(101,'16.6','Develop effective, accountable and transparent institutions at all levels',16,'SDG 16 -  Peace and Justice Strong Ins